import 'dart:convert';
import 'dart:developer';

import "package:async/async.dart";
import 'package:path/path.dart';
import 'dart:io';
import 'package:http/http.dart' as http;

Future<dynamic> aiRecogintion(File imageFile) async {
  String message = "";
// ignore: deprecated_member_use
  var base64Img = base64Encode(imageFile.readAsBytesSync());
  var uri = Uri.parse("http://home112.ddns.net/report_api/tlpr.php");

  base64Img = "";

  http.post(uri, body: {
    "image": base64Img,
    "name": "test.jpg",
  }).then((result) {
    result.statusCode == 100 ? (jsonDecode(result.body)['recognition'] == null ? message = "Can\'t identify this image, please try again" : jsonDecode(result.body)['recognition']) : message = "Server Error";
  });
  log(message);
}